pragma solidity ^0.5.11;

contract AliveTest {

    string public inputData;
    address public owner;
    string public state;
    uint public endTime;

    enum Status {
        unknown, alive, missing
    }
    Status statusNow;
    Status constant defaultstatusNow = Status.unknown;
    constructor() public
        {
            owner = msg.sender;
        }
    modifier isOwner (){
        require(msg.sender == owner, "Invalid Authentication");
        _;
    }

    function getInput (string memory statusKey) public isOwner() {
        inputData = statusKey;
    }

    function storageState () public isOwner() returns (Status) {
        if(keccak256(abi.encodePacked(inputData)) == keccak256(abi.encodePacked("I am alive")) ){
            statusNow = Status.alive;
        }
        return statusNow;
    }
    function setTimer() public {
        endTime = now + 60 seconds;
    }
    function isEnd () public isOwner() returns(Status){
        if( endTime == now){
            statusNow = Status.missing;
            return statusNow;
        }
    }
}
